function doDiff() {
    module('robert.private.diffing.ObjectEnumaration').load(true);
    var left = eval(this.get('left').textString),
        right = eval(this.get('right').textString);

    var filterFunc = function(obj, key, value) {
        return (obj === left && key == 'owner') ||
            (obj === right && key == 'owner') ||
            (value && value.nodeType !== undefined) ||
            (value === Global) || 
            (obj.isGradient && key == 'stops') ||
            (obj instanceof lively.morphic.Text && (
                key == 'textChunks' || key == 'doitContext' || key == 'priorSelectionRange'
            )) ||
            (['halos', '_renderContext', 'dispatchTable', 'livelyClosure'].include(key))
    }
    var differ = new lively.persistence.DiffCreator();
    try { diff = differ.diff(left, right, filterFunc); } catch(e) { alert(e) }
    var msg = '' + diff.conflicts.length + ' conflicts ' + '\n\n' + diff.conflicts.pluck('path').join('\n')
    this.get('result').setTextString(msg)

}
